import Vue from "vue";
import VueRouter from "vue-router";

Vue.use(VueRouter);

function importComponent(path) {
  return () => import(`./components/${path}.vue`);
}

const router = new VueRouter({
  mode: "history",
  routes: [
    {
        path: '/',
        component: Page,
        children: [
          {
            path: '',
            name: 'Dashboard',
            component: Dashboard,
            auth: true
          },
          {
            path: 'users',
            name: 'Users',
            component: Users,
            auth: true
          }
        ]
      },
      {
        path: '/login',
        name: 'Login',
        component: Login
      }
  ],
});

export default router;
